import java.util.Hashtable;

public class Main {
    public static void main(String[] args) {
        Hashtable<String, Integer> table = new Hashtable<>();

        // Populate the hashtable with initial data
        table.put("one", 1);
        table.put("two", 2);
        table.put("three", 3);

        // Setup a misleading variable
        int someNumber = 5;

        // Operations that don't affect the read value
        table.put("four", 4 + someNumber); // Just an unrelated computation
        someNumber *= 2; // Irrelevant computation

        // Conditional logic that affects the execution of write
        if (someNumber % 2 == 0) {
            /* write */ table.put("readKey", 42); // The actual write that affects the read
        } else {
            table.put("randomKey", 100); // Misleading write
        }

        int anotherCalculation = (someNumber / 2) * 3; // More confusing calculations

        // Some more manipulations
        table.put("five", 5);
        table.put("superfluous", someNumber + anotherCalculation);

        // Finally, the read point
        /* read */ int ret = table.get("readKey");

        System.out.println("Retrieved Value: " + ret);
    }
}
